import React from "react";

import Directory from "../../components/directory/directory.component";
import './homepage.style.css'

const HomePage = (props) => {
  return (
    <div className="homepage-display-grid">
      <div className="homepage-display-flex">
        <div className='homepage-display-items'>
        <img src=' https://images.ctfassets.net/5de70he6op10/6jZ55m4laSQ27tvuIAb205/a881f1e6487322d9da1a8e59314ea31a/011121_HPG_LS_1.jpg' width='900' height='676'/>
        </div>
        
        <div className="homepage-display-split">
         <img src='https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/beautiful-festive-hand-made-candles-and-a-wooden-royalty-free-image-1601566745.jpg?crop=0.590xw:0.883xh;0.173xw,0.0611xh&resize=980:*'width='300'/>
          <h1>Image 3</h1>
        </div>
        <div className='homepage-display-items'>
        <img src=' https://images.ctfassets.net/5de70he6op10/kS1y4K6FtUt74xkNBefwW/c870b8242cb2e203c4a1bf70d585793f/011121_HPG_LS_4.jpg?w=2882&q=80&fm=webp' width='900' height='441'/>
        </div>
      </div>
      <div className="homepage-display-flex">
        <img src='https://i1.wp.com/artmyideas.com/wp-content/uploads/2018/12/50-Beautiful-Bedroom-Wall-Art-Ideas-And-Decorations-16.jpg?w=1200&ssl=1'width='300'/>
        <img src='https://xcdn.next.co.uk/common/Items/Default/Default/Publications/G27/shotview-315x472/8052/671-151s.jpg'width='400'/>
      </div>
    </div>
  );
};

export default HomePage;
